Our 77 Series metal intake kits for trucks and SUVs combine outstanding performance and under-the-hood style.nbsp; Many consumers will opt for the visual appeal of these kits. The metallic finishes are bold and beautiful.nbsp; Polished finish kit parts end in "KP".nbsp; Grey finish kits end in "KG".nbsp;
Restriction can exist BETWEEN an air filter and the engine reducing the benefit of a Kamp;N Air Filter alone.nbsp; The weakest link in the airflow chain robs a vehicle of its natural horsepower.nbsp; Often that weak point is the factory air path leading to the Engine.nbsp; Kamp;N Air Intake Kits virtually eliminate air path restriction by replacing the air filter and the entire air path to the engine.nbsp; The aerodynamically engineered aluminum tube drives a massive amount of air into an engine, which translates into POWER.
